import React from "react";
const Card = (props) => {
    const {name , email , id} = props;
    return (
        <div className='bg-light-yellow pa3 ma6 grow bw2 shadow-5 tc'>
            <img alt='robot' src={`https://robohash.org/${id}?200×200`} />
            <h2> {props.name} </h2>
            <p> {props.email} </p>
        </div>
    )
}
export default Card
